webpackJsonp([0xb43884f9ff4],{6489:function(e,t){e.exports={data:{post:{html:"<p>Just so you know, on the new BMW 500 series the on-board computer monitors the tire pressure for you. But if you ever change the tires (for example, for winter), you have to re-initialize the system. Otherwise the computer will warn you of a flat tire when you have none. That can be very disquieting when doing 200 on the Autobahn. Just so you know.</p>",fields:{title:"ctrl-alt-del",date:"09 Nov 2003",url:"https://papascott.de/2003-11-09-ctrl-alt-del/"}}},pathContext:{slug:"/2003-11-09-ctrl-alt-del/",prev:{fields:{title:"Castor is on it's way again",date:"09 Nov 2003",slug:"/2003-11-09-castor-is-on-its-way-again/"}},next:{fields:{title:"SecurityFocus RSS Feeds",date:"09 Nov 2003",slug:"/2003-11-09-securityfocus-rss-feeds/"}}}}}});
